import React, { Component }  from 'react';
import PropTypes from 'prop-types';



interface YoutubeThumbnailPropTypes {
    youtubeId: string;
    style?: React.CSSProperties;
  }

const YoutubeThumbnail = ({youtubeId, style}: YoutubeThumbnailPropTypes) => <img
    style={{
        '-webkit-user-drag': 'none',
        userDrag: 'none',
        ...(style ?? {})
    }}
    src={"https://i3.ytimg.com/vi/" + youtubeId + "/maxresdefault.jpg"}
    alt="YouTube thumbnail image" />;


export { YoutubeThumbnail };
